import { useState } from "react";
import ''

function ReviewForm() {
  const [title, setTitle] = useState("");

  const handleTitleChange = (e) => {
    setTitle(e.target.value);
  };
  return (
    <form>
      <input value={title} onChange={handleTitleChange} />
    </form>
  );
}

export default ReviewForm;
